body nav.navigation {
  width: 100%;
  display: grid;
  grid-template-columns: auto 180px;
  grid-template-areas: "logo burger";
  background-color: #fff;
  box-shadow: 1px 1px 10px rgba(141, 141, 141, 0.658);
  z-index: 100;
  position: fixed;
  top: 0;
  left: 0;
}
body nav.navigation .dropdown,
body nav.navigation .genres_menu {
  width: 100%;
  height: 100vh;
  position: fixed;
  top: 0;
  left: 0;
  background-color: var(--menu);
  padding: 2rem 2rem 3rem;
  z-index: 10;
}
body nav.navigation .dropdown p,
body nav.navigation .genres_menu p {
  color: white;
  text-align: right;
  font-size: 1.2rem;
  cursor: pointer;
}
body nav.navigation .dropdown li,
body nav.navigation .genres_menu li {
  line-height: 5rem;
  font-size: 1rem;
  color: var(--white);
  list-style: none;
}
body nav.navigation :root {
  --width: calc(100vw / 2 - 1px);
}
body nav.navigation .genres_menu {
  padding: 0;
  display: grid;
  grid-template-areas: "top_subjects divider sub_subjects";
  grid-template-columns: var(--width) 2px var(--width);
}
body nav.navigation .genres_menu p {
  grid-area: sub_subjects;
  padding: 1rem 2rem;
}
body nav.navigation .genres_menu ul {
  grid-area: top_subjects;
  padding: 1rem 2rem;
}
body nav.navigation .burger {
  display: flex;
  align-items: center;
  justify-content: space-around;
  height: 100%;
  padding: 1rem;
  grid-area: burger;
}
body nav.navigation header {
  padding: 0.5rem 0.5rem 0 1rem;
  grid-area: logo;
}
body nav.navigation header img {
  width: 170px;
  padding-top: 0.4rem;
}
body nav.navigation .burger img:not(.profile_menu) {
  width: 23px;
  height: 23px;
  grid-area: burger;
  cursor: pointer;
}
body nav.navigation .menu ul {
  display: none;
}
body nav.navigation li:last-child {
  list-style: none;
  cursor: pointer;
}
body nav.navigation .menu li {
  list-style: none;
  display: inline;
}
body nav.navigation .menu {
  display: none;
}
body nav.navigation .settings {
  width: 18px;
  height: 18px;
}
body nav.navigation .profile_menu {
  width: 25px;
  height: 25px;
  padding-top: 0.3rem;
}
body nav.navigation div.burger > a:nth-child(4) > img {
  width: 40px;
  height: 22px;
  border-radius: 10%;
  object-fit: cover;
}
body nav.navigation .search_bar {
  height: 100%;
  position: relative;
  display: flex;
  align-items: center;
}
body nav.navigation .search {
  width: 22px;
  height: 22px;
}
body nav.navigation .hide {
  display: none;
}
body nav.navigation .add_opacity {
  transition: 0.5s;
  opacity: 0;
}
body nav.navigation .remove_opacity {
  transition: 0.5s;
  opacity: 1;
}
body nav.navigation .shrink_title {
  animation: shrink_kf 0.5s ease-in 1 forwards;
}
body nav.navigation .enlarge_title {
  animation: enlarge_kf 0.3s ease-in 1 forwards;
}
body nav.navigation .shrink_site {
  animation: shrink_site_kf 0.3s ease-in 1 forwards;
}
body nav.navigation .enlarge_site {
  animation: shrink_site_kf 0.3s ease-in 1 forwards;
}
