    box-shadow: 1px 1px 10px rgba(141, 141, 141, 0.658);
    z-index: 100;
    position: fixed;
    top: 0;
    left: 0;

    .dropdown,
    .genres_menu {
      width: 100%;
      height: 100vh;
      position: fixed;
      top: 0;
      left: 0;

      background-color: var(--menu);
      padding: 2rem 2rem 3rem;
      z-index: 10;
    }

    .dropdown p,
    .genres_menu p {
      color: white;
      text-align: right;
      font-size: 1.2rem;
      cursor: pointer;
    }

    .dropdown li,
    .genres_menu li {
      line-height: 5rem;
      font-size: 1rem;
      color: var(--white);
      list-style: none;
    }
    :root {
      --width: calc(100vw / 2 - 1px);
    }
    .genres_menu {
      padding: 0;
      display: grid;
      grid-template-areas: "top_subjects divider sub_subjects";
      grid-template-columns: var(--width) 2px var(--width);
    }

    .genres_menu p {
      grid-area: sub_subjects;
      padding: 1rem 2rem;
    }

    .genres_menu ul {
      grid-area: top_subjects;
      padding: 1rem 2rem;
    }
    .burger {
      display: flex;
      align-items: center;
      justify-content: space-around;
      height: 100%;
      padding: 1rem;
      grid-area: burger;
    }

    header {
      padding: 0.5rem 0.5rem 0 1rem;
      grid-area: logo;
    }

    header img {
      width: 170px;
      padding-top: 0.4rem;
    }

    .burger img:not(.profile_menu) {
      width: 23px;
      height: 23px;
      grid-area: burger;
      cursor: pointer;
    }

    .menu ul {
      display: none;
    }
    li:last-child {
      list-style: none;
      cursor: pointer;
    }

    .menu li {
      list-style: none;
      display: inline;
    }

    .menu {
      display: none;
    }

    .settings {
      width: 18px;
      height: 18px;
    }
    .profile_menu {
      width: 25px;
      height: 25px;
      padding-top: 0.3rem;
    }

    div.burger > a:nth-child(4) > img {
      width: 40px;
      height: 22px;
      border-radius: 10%;
      object-fit: cover;
    }

    .search_bar {
      height: 100%;
      position: relative;
      display: flex;
      align-items: center;
    }

    .search {
      width: 22px;
      height: 22px;
    }

    .hide {
      display: none;
    }

    .add_opacity {
      transition: 0.5s;
      opacity: 0;
    }
    .remove_opacity {
      transition: 0.5s;
      opacity: 1;
    }

    ///ANIMATIONS

    .shrink_title {
      animation: shrink_kf 0.5s ease-in 1 forwards;
    }
    .enlarge_title {
      animation: enlarge_kf 0.3s ease-in 1 forwards;
    }
    .shrink_site {
      animation: shrink_site_kf 0.3s ease-in 1 forwards;
    }
    .enlarge_site {
      animation: shrink_site_kf 0.3s ease-in 1 forwards;
    }

    ///KEYFRAMES

    @media (min-width: 375px) {
      .menu {
        display: grid;
        justify-items: flex-end;
        align-items: center;
        background-color: var(--secondary);
        background-color: var(--white);
        color: var(--black);
        grid-area: nav;
        display: none;

        grid-template-columns: auto 11rem 3rem 3rem;
      }
      ul {
        padding: 0rem 2rem 0rem;
      }
    }
    @media (min-width: 400px) {
      header img {
        width: 45vw;
        padding-top: 0;
      }
    }
  }

  @media (min-width: 660px) {
    nav.navigation {
      width: 100%;
      display: grid;
      grid-template-areas:
        "logo burger"
        "nav nav";
      background-color: #fff;
      box-shadow: 1px 1px 10px rgba(141, 141, 141, 0.658);
      z-index: 10;
      grid-template-columns: auto 170px;

      header img {
        width: 65vw;
        padding-top: 0;
        max-width: 650px;
      }

      .menu {
        grid-template-columns: auto 18rem 11rem 3rem 3rem;
      }
      .menu ul {
        display: flex;
        width: 100vw;
        height: 2rem;
