      }

      .burger img.bigger {
        width: 28px;
        height: 28px;
        transition: 0.5s;
      }

      .burger img.profile_menu.bigger {
        width: 28px;
        height: 28px;
        transition: 0.5s;
        transform: translateY(-2px);
      }

      div.burger > a:nth-child(4) > img.bigger {
        width: 40px;
        height: 40px;
        border-radius: 10px;
        object-fit: cover;
      }
      .burger img.profile_menu {
        width: 22px;
        height: 22px;
