      }

      @keyframes shrink_kf {
        0% {
          width: 65vw;

          padding-left: 0.5rem;
        }
        100% {
          width: 170px;
          padding-left: 0;
        }
      }

      @keyframes enlarge_kf {
        0% {
          width: 170px;
          padding-left: 0;
        }
        100% {
          width: 65vw;
          padding-left: 0.5rem;
        }
      }
      .shrink_site {
        animation: shrink_site_kf 0.3s ease-in 1 forwards;
      }

      @media (min-width: 900px) {
        @keyframes shrink_kf {
          0% {
