sources.sass/partials/_article.scss:
.article {
  main > p {
    padding: 1rem;
  }
  .text.manchet {
    font-weight: 600;
  }

  p {
    font-weight: 300;
  }

  .article_container {
    padding: 1rem;
  }
  .header_image {
    background-image: url("/images/austin-neill-hgO1wFPXl3I-unsplash.jpg");
    background-size: cover;
    width: 100%;
    height: 500px;
    background-repeat: no-repeat;
    background-position: center;
    filter: brightness(0.8);
  }
  .article_section {
    padding-bottom: 2rem;

    h1 {
      color: var(--primary);
    }
  }

  .article_wrapper {
    padding-bottom: 3rem;
  }

  .advert_image {
    background-image: url("/images/youtube-music.png");
    background-position: center;
    background-size: cover;
    background-repeat: no-repeat;
    width: 100%;
    height: 200px;
  }
  .author,
  .date {
    font-size: 0.7rem;
    font-style: oblique;
    color: var(--secondary);
    line-height: 0.9rem;
  }
  .date {
    padding-bottom: 2rem;
  }

  .text {
    line-height: 1.5rem;
    padding-bottom: 1rem;
  }
  .article_title {
    margin-bottom: 1.5rem;
  }
  .bold {
    font-weight: 700;
    line-height: 1.5rem;
  }

  li {
    line-height: 1.5rem;
  }

  ///ASIDE

  aside {
    border: 1px solid var(--black);
    padding: 1rem;
  }

  .band_box {
    padding-bottom: 2rem;
    p:not(.article_title) {
      color: var(--primary);
      font: var(--title);
      font-size: 1.2rem;
      line-height: 2.5rem;
    }
  }
  //COMMENTS

  .profile {
    box-shadow: var(--lg-shadow);
    width: 50px;
    height: 50px;
    margin-top: 0.01rem;
  }

  .profile_name {
    font-size: 0.8rem;
    font-weight: 600;
  }

  .time_sent {
    font-size: 0.75rem;
    font-family: "Playfair Display", serif;
    font-style: italic;
    font-weight: 600;
    color: var(--primary);
    line-height: 1.3rem;
  }
  .comment_container {
    padding: 2rem 0 0;
    max-width: 600px;
  }

  .comment_wrapper {
    display: grid;
    grid-template-columns: 60px auto;
    padding-bottom: 2rem;
    img {
      object-fit: cover;
      border-radius: 2px;
    }
  }

  .comment {
    box-shadow: var(--sm-shadow);
    background-color: var(--tertiary);
    padding: 1rem;
    border-radius: 2px;
  }
  .message_wrapper {
    display: grid;
    grid-template-columns: 60px auto;
    grid-template-areas: ". message";
    max-width: 600px;
    padding-bottom: 2rem;
  }
  textarea {
    width: 100%;
    grid-area: message;
    padding: 1rem 1rem 1rem;
    resize: none;
    border-radius: 2px;
    border: 1px solid var(--tertiary);
    box-shadow: var(--sm-shadow);

    &::placeholder {
      font: var(--paragraph);
      line-height: 4rem;
    }
  }
  svg {
    grid-area: message;
    z-index: 10;
    align-self: flex-end;
    justify-self: flex-end;
    margin: 0 1rem 1rem 0;
  }

  @media (min-width: 820px) {
    .article_section {
      padding-bottom: 0;
    }
    .article_wrapper {
      display: grid;
      grid-template-columns: 2fr 1fr;
      gap: 2rem;
      border-bottom: 1px solid var(--secondary);
      padding-bottom: 2rem;
      margin-bottom: 2rem;

      .adverts {
        height: fit-content;
        align-self: flex-end;
        margin-bottom: 1rem;
      }
    }
  }
}

sources.sass/partials/_login.scss:
.login {
  position: relative;
  .login_form > * {
    display: block;
  }

  .login_wrapper {
    display: grid;
    height: 100vh;
    grid-template-rows: repeat(4, 1fr);
    grid-template-areas:
      "one"
      "two"
      "three"
      "four";
    .login,
    .signup {
      padding: 2rem;
      p,
      label,
      button {
        margin-bottom: 0.5rem;
      }
      form {
        width: 100%;
      }

      label:nth-child(2) {
        padding-bottom: 0.5rem;
      }

      .orange {
        color: var(--primary);
        font: var(--button);
        font-size: 0.8rem;
        font-weight: 400;
        cursor: pointer;
      }
    }
  }

  input {
    display: block;
    width: 100%;
    padding: 0.5rem 0.5rem;
    border-radius: 5px;
    border: 1px solid var(--secondary);
    box-shadow: var(--sm-shadow);
  }

  .button_wrapper {
    display: flex;
    width: 100%;
    justify-content: space-between;
  }

  .overlay > * {
    color: var(--white);
    font-style: normal;
  }

  .image {
    background-position: center;
    background-repeat: no-repeat;
    background-size: cover;
    height: 100%;
    filter: brightness(0.6);
    z-index: -1;
  }

  .community {
    display: grid;
    grid-template-areas: "community";
    grid-area: two;
    height: 100%;
    .image {
      background-image: url("/images/c-d-x-PDX_a_82obo-unsplash.jpg");
      grid-area: community;
    }
    .overlay {
      grid-area: community;
      h1 {
        padding-left: 32%;
      }
      .article_title {
        padding: 2rem 1rem 0 10%;
      }
    }
  }
  .special {
    display: grid;
    grid-template-areas: "special";
    height: 100%;
    grid-area: four;
    .image {
      background-image: url("/images/nicholas-green-nPz8akkUmDI-unsplash.jpg");
      grid-area: special;
    }
    .overlay {
      grid-area: special;
      h1 {
        padding-left: 60%;
      }
      .article_title {
        padding: 2rem 1rem 0 20%;
      }
    }
  }
  .signup {
    height: 100%;
  }

  // FORGOT
  .forgot {
    display: flex;
    align-items: center;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    position: fixed;
    top: 0;
    left: 0;
    width: 100vw;
    height: 100vh;

    background-color: var(--white);
    .close {
      position: fixed;
      top: 1rem;
      right: 1rem;
      font-size: 1.5rem;
      color: var(--white);
      cursor: pointer;
    }
    &.hide {
      display: none;
    }
  }
  .forgot_wrapper {
    height: fit-content;
    margin-bottom: 7rem;
    width: 100%;
    padding: 1rem;
    .article_title {
      color: var(--primary);
      margin-bottom: 1rem;
    }
    input {
      margin-bottom: 1rem;
    }
    p {
      margin-bottom: 0.5rem;
    }
    button {
      align-self: flex-end;
    }
  }
  .devider_wrapper {
    display: grid;
    grid-template-columns: auto 5rem auto;
    align-items: center;
    padding: 2rem 0;

    h1 {
      text-align: center;
    }
    .devider {
      background-color: var(--black);
      height: 1px;
      width: 100%;
    }
  }

  .password,
  .email {
    display: flex;
    flex-wrap: nowrap;
    flex-direction: column;
  }

  @media (min-width: 850px) {
    .login_wrapper {
      grid-template-rows: repeat(2, 1fr);
      grid-template-columns: repeat(2, 1fr);
      grid-template-areas:
        "one two"
        "four three";
    }

    .community .overlay h1 {
      padding-left: 32%;
    }

    .community .overlay .article_title {
      padding: 35% 1rem 0 10%;
      font-size: 1.5rem;
    }
    .special .overlay h1 {
      padding-left: 55%;
    }
    .special .overlay .article_title {
      padding: 30% 1rem 0 10%;
      font-size: 1.5rem;
    }
    .forgot {
      flex-wrap: nowrap;
      flex-direction: row;
      justify-content: center;
      width: 100vw;
      background-color: rgba(0, 0, 0, 0.651);

      .article_title {
        font-size: 1rem;
      }
    }
    .forgot > article {
      background-color: var(--white);
      width: 600px;
      height: 510px;
      padding: 2rem 4rem;
      border-radius: 5px;
    }
  }

  @media (min-width: 1100px) {
    .community .overlay h1 {
      padding-left: 32%;
    }
    .community .overlay .article_title {
      padding: 25% 1rem 0 10%;
      font-size: 1.5rem;
    }
    .special .overlay h1 {
      padding-left: 45%;
    }
    .special .overlay .article_title {
      padding: 20% 1rem 0 10%;
      font-size: 1.5rem;
    }
  }
}

sources.sass/style.scss:
@use "partials/header";
@use "partials/footer";
@use "partials/frontpage";
@use "partials/profile";
@use "partials/article";

@use "partials/bookmarks";
@use "partials/login";
@use "partials/myarticles";
@use "partials/newarticle";
@use "partials/search";

:root {
  /* ######################################### */
  /* ----------- VARIABLES ----------- */
  /* ######################################### */

  /* ------- COLORS ------- */
  --primary: #f76820;
  --secondary: #707070;
  --tertiary: #dedede;
  --dark-grey: #383838;
  --menu: #383838;
  --white: #ffffff;
  --black: #000000;

  /* ------- FONTS ------- */

  --heading1: italic 400 1.8rem "Playfair Display", serif;
  --heading2: 300 1.5rem "Open Sans", sans-serif;
  --heading3: 300 1.2rem/2rem "Open Sans", sans-serif;
  --menu-elements: 400 0.75rem "Open Sans", sans-serif;
  --title: italic 400 1.3rem "Playfair Display", serif;
  --paragraph: 300 0.9rem/1.2rem "Open Sans", sans-serif;
  --button: italic 600 0.85rem "Playfair Display", serif;

  /* ------- SHADOW ------- */

  --sm-shadow: 0px 2px 10px rgba(0, 0, 0, 0.1);
  --lg-shadow: 1px 2px 3px rgba(0, 0, 0, 0.205);
  --md-shadow: 0px 3px 4px rgba(0, 0, 0, 0.2);
}

* {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}

.profile_page,
.article,
.login_wrapper {
  max-width: 1200px;
  margin: 0 auto;
}

p,
label {
  font: var(--paragraph);
}

h1 {
  font: var(--heading1);
}

h2 {
  font: var(--heading2);
}
h3 {
  font: var(--heading3);
}
.menu_elements {
  font: var(--menu-elements);
}

.article_title {
  font: var(--title);
}
.breadcrumb {
  color: var(--primary);
}
//BUTTONS

button {
  font: var(--button);
  cursor: pointer;
}

.primary {
  background-color: var(--primary);
  color: var(--white);
}

.secondary {
  background-color: var(--secondary);
  color: var(--tertiary);
}

.tertiary {
  background-color: var(--tertiary);
  color: var(--black);
}

button {
  width: 4rem;
  outline: none;
  font: var(--button);
  padding: 0.5rem 0.5rem;
  border: 0;
  border-radius: 5px;
  box-shadow: var(--md-shadow);
  &:hover {
    transform: scale(1.04);
    transition: 0.3s;
  }
}

.all {
  width: 100%;
  text-align: right;
  font-weight: 700;
  font-size: 0.75rem;
  padding-bottom: 2rem;
  &.white {
    color: var(--white);
  }
  span {
    color: var(--primary);
    font-size: 0.9rem;
  }
}

@media (min-width: 500px) {
  :root {
    --heading1: italic 400 2.4rem "Playfair Display", serif;
    --title: italic 400 1.8rem "Playfair Display", serif;
  }
}
